import './Title.css';
import Media from 'react-media';
import ReturnQuOte from './Quote';
import Sign from './Sign/Input';

// Return logo
export default function ReturnTitle() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-title-admin'>
  <TextView />
  <ReturnQuOte />
  <Sign />
 </div>
)
export const ScreenSmall = () => (
 <div className='wrp-title-admin-sm'>
  <TextView />
  <ReturnQuOte />
  <Sign />
 </div>
)
export const TextView = () => (
 <h1>
  <span className='Red'>Muungano</span>
  <span className='Yellow'>Money</span>
  <span className='White'>admin</span>
 </h1>
)
